import { Table, Tbody, Tr, Td} from "@chakra-ui/react";
import { useState } from "react";

const TableElement = ({data}) => {

  const tableStyle = {
    border: "1px solid #FFF",
  };

  const dataRowStyle = {
    color: "#FFF",
    borderRight: "1px solid white",
    padding: "8px",
  };

  if(data.length === 0) {
    return null;
  
  }

  return(
    <Table style={tableStyle}>
      <Tbody>
        
        <Tr>
            <Td style={dataRowStyle}>{name}</Td>
            <Td style={dataRowStyle}>{email}</Td>
            <Td style={dataRowStyle}>{cpf}</Td>
            <Td style={{...dataRowStyle, border: "none"}}>{age}</Td>
        </Tr>
      </Tbody>
    </Table>
  );
}

export default TableElement;
